import React, {memo} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const DetailPagesContainer = styled.div`
    width:100%;
    height:auto;

    .contentWrap{
        width:1200px;
        margin:0 auto;
        color:#333333;

        .summaryWrap{
            margin-top:140px;

            .title{
                font-size:24px;
                font-weight: 500;
                width:100%;
                height: auto;
            }

            .tableWrap{
                margin-top:20px;
                width:100%;

                .tableItem{
                    border-bottom:1px solid #D9D9D9;
                    background-color: #ff05;
                    height: 300px;

                    .conTit{
                        background-color: #f5f5f5;
                        height: 60px;
                        width:140px;
                        /* line-height: 60px; */
                        /* vertical-align: middle; */
                        padding-left:20px;
                    }

                    .conTxt{
                        height: auto;
                        padding-left:20px;
                    }

                    &.rowOne{
                        border-top:2px solid #333333;
                        display: flex;
                        height: 60px;

                        .colOne{
                            width:50%;
                            background-color: #f0f4;
                            display: flex;
                            align-items: center;
                        }

                        .colTwo{
                            width:50%;
                            background-color: #0f03;
                            display: flex;
                        }
                    }

                    &.rowTwo{
                        height: 60px;
                        display: flex;
                    }

                    &.rowThr{
                        height: 300px;
                        display: flex;
                        align-items: center;

                        .conTxt{
                            line-height: 1;
                            /* background-color: #000; */
                        }
                    }

                    &.rowFou{
                        height:60px;
                        display: flex;

                        .colOne{
                            width:50%;
                            background-color: #00f4;
                        }

                        .colTwo{
                            width:50%;
                            background-color: #f003;
                        }
                    }

                }

            }
        }
    }

`;

const DetailPages = memo(() => {
    return (
        <DetailPagesContainer>
        <Title title='취업지원' txt='취업 준비생 여러분의 취업을 돕기위한 정책들을 확인해보세요.' />
        <div className='contentWrap'>
            <div className='summaryWrap'>
                <h2 className='title'>정책요약</h2>  
                <div className='tableWrap'>
                    <div className='tableItem rowOne'>
                        <div className='colOne'>
                            <p className='conTit'>정책 번호</p>
                            <p className='conTxt'>R2024010218403</p>
                        </div>
                        <div className='colTwo'>
                            <p className='conTit'>정책 분야</p>
                            <p className='conTxt'>일자리</p>
                        </div>
                    </div>
                    <div className='tableItem rowTwo'>
                        <p className='conTit'>정책 소개</p>
                        <p className='conTxt'>국민취업지원제도 참여 요건을 갖추신 분은 취업지원서비스를 제공받으실 수 있고 셍계를 위한 최소한의 소득도 지원받으실 수 있습니다.</p>
                    </div>
                    <div className='tableItem rowThr'>
                        <p className='conTit'>지원 내용</p>
                        <p className='conTxt'>취업 지원- 직업 훈련, 일 경험, </p>
                    </div>
                    <div className='tableItem rowFou'>
                        <div className='colOne'>
                            <p className='conTit'>지원 규모(명)</p>
                            <p className='conTxt'></p>
                        </div>
                        <div className='colTwo'>
                            <p className='conTit'>비고</p>
                            <p className='conTxt'></p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        </DetailPagesContainer>
    );
});

export default DetailPages;
